import React, { useState } from "react";
import ImagesresH from "./ImagesresH";
const Catogreis = () => {
  const FilterCatogries = ["All", "Photos", "illustration", "vectors"];
  const [fdata,setFdata] = useState(FilterCatogriesFilterCatogries)
  let num = 0;

  const fetcatfilter = (data) => {
    setFdata(data);
    alert(fdata)
  };

  return (
    <>
      <div className="filter-catogries">
        {FilterCatogries.map((filter) => {
          return (
            <>
              <div
                key={num++}
                className="filter-cat-name "
                onClick={() => fetcatfilter(filter)}
              >
                {filter}
              </div>
            </>
          );
        })}
      </div>
      <ImagesresH />
    </>
  );
};

export default Catogreis;
